import React from 'react'

import classes from './HomeGrid.module.css'

const TILES = [
    { 
        title: "Calendar",
        color: "GreenSheen"
    },
    { 
        title: "Todo",
        color: "PrincetonOrange"
    },
    { 
        title: "Analytics",
        color: "CarolinaBlue"
    },
    { 
        title: "Countdown",
        color: "MikadoYellow"
    },
]

const Tile = ({ title, displayData, color }) => (
    <div className = { [ classes.Tile, classes[color] ].join(' ') }>
        <p className = { classes.Title }>{ title }</p>
    </div>
)

const Grid = () => (
    <div className = { classes.Grid }>
        { 
            TILES.map(tile => 
                <Tile 
                    key = { tile.title }
                    title = { tile.title }
                    color = { tile.color } />)
        }
    </div>
)

export default Grid
